clear_fusion_paper:"You wrote a paper on nuclear fusion.<br/>You gained +1 wisdom!",clickmsg_found_green_mushroom:"You found a green mushroom.<br/>You gained +1 level!",clickmsg_meet_old_wizard:"Vous meet a mysterious old wizard…<br/>Before giving you the quest, he tells you his loooong story : Vous gain +1 wisdom!",clickmsg_good_necromancer:"You meet a child weeping over his dead hamster pet… Thanks to necromancy, you reanimate it an a hamster-zombie! Oddly, the child cries even more while running away. Fortunately, you gain +1 agility for avoiding the stones thrown by the villagers.",clickmsg_talk_to_all_villagers:"You spoke to all villagers in the village : no quest may have escaped you! On the other hand, your head aches for discussing so much.<br/>+1 mana thanks to this mental training!",clickmsg_always_keep_potions:'En bon aventurier, vous aviez gardé une potion de soin "au cas où" : Bravo, votre santé est entièrement restaurée !',clickmsg_lost:"Avec toutes ces quêtes, vous en avez oublié où vous deviez aller. Mais tourner en rond dans toute la région est bon pour votre santé : +1 en vitalité !",clickmsg_fate_sword:'Pour vous remercier d’avoir sauvé sa femme et ses enfants, le fermier vous offre "destinée", l’épée transmise dans sa famille de générations en générations. 30 minutes plus tard, le marchand ne vous en donne que 17 écus... Ah ces pauvres !!!',clickmsg_grinding:"Faute de mieux, vous grindez pendant des heures et des heures… Et oui, c’est un RPG, vous vous attendiez à quoi ? Mais ça paie : +1 niveau !",clickmsg_so_many_potions:"Le combat contre le boss final fut dur, très dur… Et surtout, +1 en force pour avoir réussi à vous retenir après avoir bu 25 potions !",clickmsg_rematch:"Vous avez été battu par un gobelin ! Honteux, vous parcourez le pays, acceptant quête sur quête pour vous entraîner. Hélas, il en a fait autant et vous bat à nouveau ! Enfin bon, le +1 de niveau servira bien quand même…",clickmsg_useless:"Arrivé au village, le maire vous assure que le pays n’est pas dangereux ; La sorcière dont vous aviez entendu parler s’est trouvé quelqu’un et ne maudis plus personne. Le cimetière hanté était un cimetière d’animaux de compagnie et les habitants sont heureux de les revoir ; Le géant aide les villageois aux travaux des champs. Vous vous sentez inutile et réfléchissez à votre place en ce monde… +1 en sagesse !",
clickmsg_escort:"Vous devez escorter un NPC important. Hélas, si vous marchez il va plus vite que vous, mais si vous courrez c’est vous qui allez trop vite ! En zigzagant et en tournant en rond ça passe. +1 en vitalité grâce à tous ces efforts !",clickmsg_rare_goods_seller:"Vous croisez sur la route un vieil homme habillé de façon excentrique. Gagné, c’est un vendeur d’objets rares ! Il vous fait un très bon prix pour une [TODO weapon]",clickmsg_progress_loop:"Il vous faudrait un meilleur équipement pour pouvoir monter en niveau. Mais il faudrait monter en niveau pour pouvoir gagner un meilleur équipement. Cruel dilemne ! Heureusement, vous trouvez un [TODO weapon] au fond d’un puit !",clickmsg_idiot_bandits:"On parle de vous après que vous ayez tué le dragon et la sorcière maléfique. Des bandits vous tendent une embuscade. Quelle drôle d’idée ! À voir ses yeux, le dernier l’a presque compris une fraction de seconde avant que votre boule de feu ne le réduise en cendre. Heureusement, les pièces d’or ne brûlent pas : +33 écus !",clickmsg_princess:"« Vous n’emporterez pas la princesse ! » vous crie le terrible mage noir, alors que vous parvenez dans sa salle du trône. Vous le rassurez : seul le butin vous intéresse. Il vous laisse vous servir (+234 écus) et enchante même une arme pour vous ! ([TODO weapon])",xclickmsg_make_friends:"",xclickmsg_unicorns:"",clickmsg_bad_village:"Vous arrivez dans un village. Il n’y a pas de marchand d’armes. Pas de marchand de potions non plus ! Et l’auberge ne propose pas de quêtes !!<br/>C’en est trop : sur votre ordre, les éclairs et les météorites rasent ce lieu inutile.<br/>Au passage, bon occasion de pratiquer votre magie : +1 mana.",xclickmsg_arrown_in_the_knee:"",xclickmsg_black_mage_again:"",clickmsg_mana_mana:"« Mah na mah na » « To to to do do »<br/>+1 mana!",object_found:"You found a [+1 Common Spiky Shield]!",combat_escaped:"You were attacked by a [Level 1 Blind Falcon] but you got away just before it was about to kill you."